void play_win_sound(void) {
    volatile int *audio_ptr = (int *) AUDIO_BASE;
    int fifo_space;
    int left_sample, right_sample;
    int melody_length = 5;
	int samples_per_note = 400;


    for (int note = 0; note < melody_length; note++) {
        for (int i = 0; i < samples_per_note; i++) {
            // check In FIFO has data
            do {
                fifo_space = *(audio_ptr + 1);
            } while (((fifo_space >> 16) & 0xFF) == 0 || ((fifo_space >> 24) & 0xFF) == 0);

            // read sample from In FIFO
            left_sample  = *(audio_ptr + 2);
            right_sample = *(audio_ptr + 3);

            // check Out FIFO space
            do {
                fifo_space = *(audio_ptr + 1);
            } while (((fifo_space >> 8) & 0xFF) == 0 || ((fifo_space >> 0) & 0xFF) == 0);

            // write to Out FIFO
            *(audio_ptr + 2) = left_sample;
            *(audio_ptr + 3) = right_sample;
        }

        for (int j = 0; j < 100; j++) {
            do {
                fifo_space = *(audio_ptr + 1);
            } while (((fifo_space >> 8) & 0xFF) == 0 || ((fifo_space >> 0) & 0xFF) == 0);
            *(audio_ptr + 2) = 0;
            *(audio_ptr + 3) = 0;
        }
    }
}

void check_win() {
    for (int i = 0; i < MAX_CARS; i++) {
        if (allCars[i].id == 'A') {
			
			//if the red car exits, return 1 for win
            if (allCars[i].x + (allCars[i].size * TILE_SIZE) >= GOAL_X) {
				winstatus = 1;
            }
        }
    }
}

//function for checking whether the move is valid before calling move_car()
int get_valid_move_position(char car_id, char direction, int *next_x, int *next_y) {
    int index = -1;

    // search for the car with the given ID
    for (int i = 0; i < MAX_CARS; i++) {
        if (allCars[i].id == car_id) {
            index = i;
            break;
        }
    }
    if (index == -1) return 0; // Invalid ID, cannot move

    Car *car = &allCars[index];

    // disallow movement that doesn't match the car's orientation
    if ((car->orientation == 'H' && (direction == 'U' || direction == 'D')) ||
        (car->orientation == 'V' && (direction == 'L' || direction == 'R'))) {
        return 0;
    }

    // calculate the new position
    int dx = 0, dy = 0;
    switch (direction) {
        case 'L': dx = -TILE_SIZE; break;
        case 'R': dx = TILE_SIZE; break;
        case 'U': dy = -TILE_SIZE; break;
        case 'D': dy = TILE_SIZE; break;
    }

    int new_x = car->x + dx;
    int new_y = car->y + dy;

    // check board boundaries
    int car_width = (car->orientation == 'H') ? (car->size * TILE_SIZE) : TILE_SIZE;
    int car_height = (car->orientation == 'V') ? (car->size * TILE_SIZE) : TILE_SIZE;

    // allow red car 'A' to exit the board to the right
    if (!(car->id == 'A' && direction == 'R')) {
        if (new_x < BOARD_START_X ||
            new_y < BOARD_START_Y ||
            new_x + car_width > BOARD_START_X + BOARD_SIZE * TILE_SIZE ||
            new_y + car_height > BOARD_START_Y + BOARD_SIZE * TILE_SIZE) {
            return 0; // Out of bounds, not allowed
        }
    }

    // check for collision with other cars
    for (int i = 0; i < MAX_CARS; i++) {
        if (i == index || allCars[i].x == -1) continue;

        int other_x = allCars[i].x;
        int other_y = allCars[i].y;
        int other_w = (allCars[i].orientation == 'H') ? (allCars[i].size * TILE_SIZE) : TILE_SIZE;
        int other_h = (allCars[i].orientation == 'V') ? (allCars[i].size * TILE_SIZE) : TILE_SIZE;

        //collision detection
        if (!(new_x + car_width <= other_x || new_x >= other_x + other_w ||
              new_y + car_height <= other_y || new_y >= other_y + other_h)) {
            return 0; // Collision detected, not allowed to move
        }
    }

    // All checks passed, movement is valid
    *next_x = new_x;
    *next_y = new_y;
    return 1;
}


